import React from 'react';
import './AuthPage.css';

const AuthPage = () => {
    return (
        <div>
            <h1>Пожалуйста авторизируйтесь</h1>
            <form action="">
                <input type="text"/>
                <input type="password"/>
            </form>

        </div>
    );
};

export default AuthPage;
